import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    window.navigator.geolocation.getCurrentPosition(
        (pos) => console.log(position),
        (err) => console.log(err)
    );

return <div>HI!</div>

}


ReactDOM.render(
    <App />,
    document.querySelector('#root')
)
